import { useState } from "react";
import AddItem from "./components/AddItem";
import Header from "./components/Header";
import TreeList from "./components/TreeList";

function App() {
  const [toggleList, setToggle] = useState(null);

  const onToggle = (key) => {
    if (toggleList === key) {
      setToggle(null);
    }

    setToggle(key);
  };

  const parents = {
    test1: {},
    test2: {},
  };

  const dataList = {
    test1: {
      one: {
        test: {},
      },
    },
    test2: {
      second: {},
    },
  };

  return (
    <div className="App">
      <Header />
      <AddItem parents={parents} />
      <TreeList data={dataList} onToggle={onToggle} toggleList={toggleList} />
    </div>
  );
}

export default App;
